enum InputMode {
  pipe,
  file,
}

extension InputModeValueExtension on InputMode {
  String toValue() {
    switch (this) {
      case InputMode.pipe:
        return 'Pipe';
      case InputMode.file:
        return 'File';
    }
  }
}

extension InputModeFromString on String {
  InputMode toInputMode() {
    switch (this) {
      case 'Pipe':
        return InputMode.pipe;
      case 'File':
        return InputMode.file;
    }
    throw Exception('$this is not known in enum InputMode');
  }
}

