  ///
  /// <code>[ {"prefix": "s3://customer_bucket/some/prefix/"},</code>
  ///
  /// <code> "relative/path/to/custdata-1",</code>
  ///
  /// <code> "relative/path/custdata-2",</code>
  ///
  /// <code> ...</code>
  ///
  /// <code> "relative/path/custdata-N"</code>
  ///
  /// <code>]</code>
  ///
